import React from 'react';
import { Camera, Star, Clock, MapPin } from 'lucide-react';
import { RouteCardProps } from '../types';

const RouteCard: React.FC<RouteCardProps> = ({ route, isSelected, onSelect }) => {
  const getPhotoScoreColor = (score: number) => {
    if (score >= 90) return 'text-green-600 bg-green-100';
    if (score >= 70) return 'text-yellow-600 bg-yellow-100';
    return 'text-red-600 bg-red-100';
  };

  return (
    <div
      className={`border rounded-lg p-4 cursor-pointer transition-all ${
        isSelected
          ? 'border-primary-500 bg-primary-50 shadow-md'
          : 'border-gray-200 hover:border-gray-300 hover:shadow-sm'
      }`}
      onClick={onSelect}
    >
      <div className="flex items-start justify-between mb-3">
        <div>
          <h3 className="font-semibold text-gray-900">{route.name}</h3>
          <div className="flex items-center space-x-4 text-sm text-gray-600 mt-1">
            <div className="flex items-center space-x-1">
              <MapPin className="h-3 w-3" />
              <span>{route.distance}</span>
            </div>
            <div className="flex items-center space-x-1">
              <Clock className="h-3 w-3" />
              <span>{route.duration}</span>
            </div>
          </div>
        </div>
        <div className={`px-2 py-1 rounded-full text-xs font-medium ${getPhotoScoreColor(route.photoScore)}`}>
          {route.photoScore}% Photo Score
        </div>
      </div>

      {route.photoSpots.length > 0 && (
        <div className="space-y-2">
          <div className="flex items-center space-x-1 text-sm text-gray-600">
            <Camera className="h-3 w-3" />
            <span>{route.photoSpots.length} photo spots</span>
          </div>
          <div className="space-y-2">
            {route.photoSpots.slice(0, 2).map((spot) => (
              <div key={spot.id} className="flex items-center space-x-3 p-2 bg-gray-50 rounded-lg">
                <img
                  src={spot.photoUrl}
                  alt={spot.name}
                  className="w-12 h-8 object-cover rounded"
                />
                <div className="flex-1 min-w-0">
                  <p className="text-sm font-medium text-gray-900 truncate">{spot.name}</p>
                  <div className="flex items-center space-x-2 text-xs text-gray-600">
                    <div className="flex items-center space-x-1">
                      <Star className="h-3 w-3 fill-current" />
                      <span>{spot.rating}</span>
                    </div>
                    <span>â€¢</span>
                    <span>{spot.distance}</span>
                  </div>
                </div>
              </div>
            ))}
            {route.photoSpots.length > 2 && (
              <p className="text-xs text-gray-500 text-center">
                +{route.photoSpots.length - 2} more spots
              </p>
            )}
          </div>
        </div>
      )}
    </div>
  );
};

export default RouteCard;
